// Aggregate all ads to calculate overall statistics
const items = $input.all();

const stats = {
  total_ads: items.length,
  high_performers: 0,
  medium_performers: 0,
  low_performers: 0,
  avg_ctr: 0,
  avg_cpa: 0,
  avg_roas: 0,
  avg_aov: 0,
  total_spend: 0,
  total_revenue: 0,
  total_purchases: 0,
  total_impressions: 0,
  total_reach: 0,
  total_adds_to_cart: 0
};

// Calculate aggregates
items.forEach(item => {
  const data = item.json;

  // Count performance labels
  if (data.performance_label === 'high') stats.high_performers++;
  else if (data.performance_label === 'medium') stats.medium_performers++;
  else stats.low_performers++;

  // Sum metrics
  stats.avg_ctr += data.ctr;
  stats.avg_cpa += data.cpa;
  stats.avg_roas += data.roas;
  stats.avg_aov += data.aov;
  stats.total_spend += data.spend;
  stats.total_revenue += data.revenue;
  stats.total_purchases += data.conversions;
  stats.total_impressions += data.impressions;
  stats.total_reach += data.reach;
  stats.total_adds_to_cart += data.adds_to_cart;
});

// Calculate averages
stats.avg_ctr = (stats.avg_ctr / items.length).toFixed(2);
stats.avg_cpa = (stats.avg_cpa / items.length).toFixed(2);
stats.avg_roas = (stats.avg_roas / items.length).toFixed(2);
stats.avg_aov = (stats.avg_aov / items.length).toFixed(2);

// Performance distribution
stats.performance_distribution = {
  high_pct: ((stats.high_performers / items.length) * 100).toFixed(1),
  medium_pct: ((stats.medium_performers / items.length) * 100).toFixed(1),
  low_pct: ((stats.low_performers / items.length) * 100).toFixed(1)
};

// Calculate overall campaign metrics
stats.overall_metrics = {
  total_roi_percentage: ((stats.total_revenue - stats.total_spend) / stats.total_spend * 100).toFixed(1),
  overall_conversion_rate: ((stats.total_purchases / stats.total_impressions) * 100).toFixed(3),
  overall_cart_abandonment_rate: (((stats.total_adds_to_cart - stats.total_purchases) / stats.total_adds_to_cart) * 100).toFixed(1)
};

// Key insights
stats.insights = {
  best_performing_metric: stats.avg_ctr > 2 ? 'Strong CTR' : 'CTR needs improvement',
  cost_efficiency: stats.avg_cpa < 40 ? 'Cost-efficient campaigns' : 'High acquisition costs',
  roi_status: stats.avg_roas > 3 ? 'Excellent ROI' : stats.avg_roas > 2 ? 'Good ROI' : 'Below target ROI',
  revenue_performance: `Generated $${stats.total_revenue.toFixed(2)} from $${stats.total_spend.toFixed(2)} spend`,
  cart_abandonment_issue: stats.overall_metrics.overall_cart_abandonment_rate > 70 ? 'High cart abandonment - needs attention' : 'Cart conversion healthy'
};

// Top findings
stats.top_findings = {
  finding_1: `${stats.high_performers} campaigns (${stats.performance_distribution.high_pct}%) are driving majority of results`,
  finding_2: `Average ROAS of ${stats.avg_roas}x across all campaigns`,
  finding_3: `${stats.overall_metrics.total_roi_percentage}% total ROI on advertising spend`
};

return [{ json: stats }];

// Create a structured training dataset for ML
const items = $input.all();

// Structure for ML training
const trainingDataset = {
  metadata: {
    dataset_name: 'facebook_ads_performance',
    created_at: new Date().toISOString(),
    total_samples: items.length,
    features: ['ctr', 'cpa', 'roas', 'impressions', 'spend', 'clicks', 'conversions'],
    target: 'performance_label',
    annotation_method: 'rule_based_with_scoring',
    data_source: 'production_facebook_ads',
    date_range: 'April 23 - April 30, 2025'
  },
  samples: []
};

// Process each ad as a training sample
items.forEach((item, index) => {
  const data = item.json;

  const sample = {
    id: data.ad_id || `ad_${index}`,
    campaign_info: {
      name: data.campaign_name,
      budget_type: data.ad_set_name || 'Not specified'
    },
    features: {
      numeric: {
        ctr: data.ctr,
        cpa: data.cpa,
        roas: data.roas,
        cpm: data.cpm,
        impressions: data.impressions,
        clicks: data.clicks,
        spend: data.spend,
        conversions: data.conversions,
        revenue: data.revenue,
        reach: data.reach,
        adds_to_cart: data.adds_to_cart,
        cart_to_purchase_rate: data.cart_to_purchase_rate,
        aov: data.aov
      },
      categorical: {
        campaign_name: data.campaign_name,
        ad_set_budget_type: data['Ad set budget type'] || 'Not specified',
        result_indicator: data.result_indicator
      }
    },
    label: data.performance_label,
    score: data.performance_score,
    metadata: {
      annotated_at: data.annotated_at,
      confidence: data.confidence_score,
      has_revenue_data: true,
      row_number: data.row_number
    }
  };

  trainingDataset.samples.push(sample);
});

// Add dataset statistics
const labelCounts = {
  high: 0,
  medium: 0,
  low: 0
};

trainingDataset.samples.forEach(s => {
  labelCounts[s.label]++;
});

trainingDataset.statistics = {
  label_distribution: labelCounts,
  label_percentages: {
    high: ((labelCounts.high / items.length) * 100).toFixed(1) + '%',
    medium: ((labelCounts.medium / items.length) * 100).toFixed(1) + '%',
    low: ((labelCounts.low / items.length) * 100).toFixed(1) + '%'
  },
  feature_ranges: {
    ctr: {
      min: Math.min(...trainingDataset.samples.map(s => s.features.numeric.ctr)),
      max: Math.max(...trainingDataset.samples.map(s => s.features.numeric.ctr)),
      avg: (trainingDataset.samples.reduce((sum, s) => sum + s.features.numeric.ctr, 0) / items.length).toFixed(2)
    },
    cpa: {
      min: Math.min(...trainingDataset.samples.filter(s => s.features.numeric.cpa > 0).map(s => s.features.numeric.cpa)),
      max: Math.max(...trainingDataset.samples.filter(s => s.features.numeric.cpa < 999).map(s => s.features.numeric.cpa)),
      avg: (trainingDataset.samples.filter(s => s.features.numeric.cpa < 999).reduce((sum, s) => sum + s.features.numeric.cpa, 0) / items.length).toFixed(2)
    },
    roas: {
      min: Math.min(...trainingDataset.samples.map(s => s.features.numeric.roas)),
      max: Math.max(...trainingDataset.samples.map(s => s.features.numeric.roas)),
      avg: (trainingDataset.samples.reduce((sum, s) => sum + s.features.numeric.roas, 0) / items.length).toFixed(2)
    }
  },
  quality_metrics: {
    samples_with_purchases: trainingDataset.samples.filter(s => s.features.numeric.conversions > 0).length,
    samples_with_positive_roas: trainingDataset.samples.filter(s => s.features.numeric.roas > 1).length,
    samples_with_high_roas: trainingDataset.samples.filter(s => s.features.numeric.roas > 3).length,
    average_confidence_score: (trainingDataset.samples.reduce((sum, s) => sum + s.metadata.confidence, 0) / items.length).toFixed(2)
  }
};

// Add annotation summary
trainingDataset.annotation_summary = {
  annotation_date: new Date().toISOString(),
  annotator: 'n8n_automated_system',
  annotation_criteria: {
    performance_thresholds: {
      high: 'Score >= 70 (CTR > 2%, CPA < $40, ROAS > 3)',
      medium: 'Score 40-69',
      low: 'Score < 40'
    },
    scoring_weights: {
      ctr_weight: '30%',
      cpa_weight: '25%',
      roas_weight: '30%',
      cart_conversion_weight: '15%'
    }
  },
  dataset_quality: 'production_ready',
  total_records_processed: items.length,
  processing_time_ms: Date.now() - new Date(trainingDataset.samples[0].metadata.annotated_at).getTime()
};

return [{ json: trainingDataset }];

// Annotate each ad with performance labels for ML training
const item = $input.item.json;

// Performance labeling criteria (updated for your data)
let performanceLabel = 'low';
let performanceScore = 0;

// CTR-based scoring (0-30 points)
if (item.ctr > 3) {
  performanceScore += 30;
} else if (item.ctr > 2) {
  performanceScore += 25;
} else if (item.ctr > 1) {
  performanceScore += 15;
} else if (item.ctr > 0.5) {
  performanceScore += 5;
}

// CPA-based scoring (0-25 points) - lower is better
if (item.cpa > 0) {
  if (item.cpa < 20) {
    performanceScore += 25;
  } else if (item.cpa < 40) {
    performanceScore += 15;
  } else if (item.cpa < 60) {
    performanceScore += 5;
  }
}

// ROAS-based scoring (0-30 points) - YOU HAVE REAL ROAS!
if (item.roas > 5) {
  performanceScore += 30;
} else if (item.roas > 4) {
  performanceScore += 25;
} else if (item.roas > 3) {
  performanceScore += 20;
} else if (item.roas > 2) {
  performanceScore += 10;
} else if (item.roas > 1) {
  performanceScore += 5;
}

// Cart-to-Purchase Rate scoring (0-15 points) - BONUS from your data!
if (item.cart_to_purchase_rate > 30) {
  performanceScore += 15;
} else if (item.cart_to_purchase_rate > 20) {
  performanceScore += 10;
} else if (item.cart_to_purchase_rate > 10) {
  performanceScore += 5;
}

// Determine performance label based on score
if (performanceScore >= 70) {
  performanceLabel = 'high';
} else if (performanceScore >= 40) {
  performanceLabel = 'medium';
} else {
  performanceLabel = 'low';
}

// Annotation metadata for ML training
const annotation = {
  performance_label: performanceLabel,
  performance_score: performanceScore,
  annotation_criteria: {
    ctr_threshold_high: 2.0,
    ctr_threshold_medium: 1.0,
    cpa_threshold_good: 40,
    roas_threshold_good: 3.0,
    cart_conversion_threshold: 20
  },
  annotated_at: new Date().toISOString(),
  annotator: 'n8n_automated_system',
  confidence_score: 0.90, // Higher confidence since we have purchase value!
  data_quality: 'production', // This is real data!
  has_revenue_data: true
};

// Special flags based on your Result indicator column
const resultFlags = {
  is_result_achieved: item['Result indicator'] ? true : false,
  result_type: item['Result indicator'] || 'none'
};

return {
  ...item,
  ...annotation,
  ...resultFlags
};

// Calculate key marketing metrics for each ad
const item = $input.item.json;

// Handle column names with potential spaces or variations
const impressions = parseFloat(item['Impressions']) || 0;
const clicks = parseFloat(item['clicks']) || 0;

// FIXED: Handle "Amount spent " with trailing space
const spend = parseFloat(item['Amount spent ']) || parseFloat(item['Amount spent']) || 0;

const purchases = parseFloat(item['Purchases']) || 0;
const purchasesValue = parseFloat(item['Purchases value']) || 0;
const reach = parseFloat(item['Reach']) || 0;
const addsToCart = parseFloat(item['Adds to cart']) || 0;
const ctrProvided = parseFloat(item['CTR (link click-through rate)']) || 0;

// Calculate CTR (or use provided one)
const ctr = ctrProvided > 0 ? ctrProvided : (impressions > 0 ? (clicks / impressions) * 100 : 0);

// Calculate CPA (Cost Per Acquisition/Purchase) - NOW WILL WORK!
const cpa = purchases > 0 ? spend / purchases : 999; // Set high CPA if no purchases

// Calculate ROAS (Return on Ad Spend) - NOW WILL WORK!
const roas = spend > 0 ? purchasesValue / spend : 0;

// Calculate CPM (Cost Per Thousand Impressions)
const cpm = impressions > 0 ? (spend / impressions) * 1000 : 0;

// Calculate Cart-to-Purchase Rate
const cartToPurchaseRate = addsToCart > 0 ? (purchases / addsToCart) * 100 : 0;

// Calculate Average Order Value
const aov = purchases > 0 ? purchasesValue / purchases : 0;

// Generate a unique ad_id
const adId = `ad_${Date.now()}_${Math.random().toString(36).substr(2, 5)}`;

// Debug log to verify spend is captured
console.log(`Campaign: ${item['Campaign name']}, Spend: ${spend}, Revenue: ${purchasesValue}, ROAS: ${roas}`);

// Return all data with calculated metrics
return {
  ...item,
  // Standardized field names
  ad_id: adId,
  campaign_name: item['Campaign name'],
  ad_set_name: item['Ad set budget type'] || 'Not specified',
  impressions: impressions,
  clicks: clicks,
  spend: spend, // This will now have the correct value!
  conversions: purchases,
  revenue: purchasesValue,
  // Calculated metrics
  ctr: parseFloat(ctr.toFixed(2)),
  cpa: parseFloat(cpa.toFixed(2)),
  roas: parseFloat(roas.toFixed(2)),
  cpm: parseFloat(cpm.toFixed(2)),
  cart_to_purchase_rate: parseFloat(cartToPurchaseRate.toFixed(2)),
  aov: parseFloat(aov.toFixed(2)),
  // Extra fields
  reach: reach,
  adds_to_cart: addsToCart,
  result_indicator: item['Result indicator']
};

// Flatten the training dataset back to individual records
const input = $input.all()[0];
const samples = input.json.samples || input.json; // Adjust based on your structure

// Return each sample as a separate item
return samples.map(sample => ({
  json: sample
}));

// Create ML-ready JSON format with correct field mapping
const allData = $input.all();

// Get the records from input
let annotatedRecords = [];

if (allData && allData.length > 0) {
  const firstItem = allData[0].json;

  if (Array.isArray(firstItem)) {
    annotatedRecords = firstItem;
  } else if (firstItem.samples && Array.isArray(firstItem.samples)) {
    annotatedRecords = firstItem.samples;
  } else {
    annotatedRecords = allData.map(item => item.json);
  }
}

// Calculate label counts
const labelCounts = {};
for (const record of annotatedRecords) {
  const label = record.label || 'unknown';
  labelCounts[label] = (labelCounts[label] || 0) + 1;
}

// Calculate feature statistics
const calculateFeatureStats = (records, featurePath) => {
  const values = records.map(record => {
    return record.features?.numeric?.[featurePath] || 0;
  }).filter(v => v > 0);

  if (values.length === 0) return { mean: 0, min: 0, max: 0, count: 0 };

  const sum = values.reduce((a, b) => a + b, 0);
  return {
    mean: Number((sum / values.length).toFixed(2)),
    min: Math.min(...values),
    max: Math.max(...values),
    count: values.length
  };
};

// Create the enhanced ML dataset
const mlDataset = {
  metadata: {
    dataset_name: "facebook_ads_performance_training_enhanced",
    created_at: new Date().toISOString(),
    total_samples: annotatedRecords.length,
    features: {
      numeric: ["ctr", "cpa", "roas", "cpm", "impressions", "clicks", "spend", "conversions", "revenue", "reach", "adds_to_cart", "cart_to_purchase_rate", "aov"],
      categorical: ["campaign_name", "ad_set_budget_type", "result_indicator"]
    },
    target: "label",
    annotation_method: "rule_based_with_scoring",
    performance_thresholds: {
      high: "≥70 points",
      medium: "40-69 points", 
      low: "<40 points"
    },
    data_source: "Facebook Ads Manager",
    annotation_confidence_avg: 0.9
  },
  samples: annotatedRecords.map((record, index) => {
    return {
      id: record.id || "campaign_" + (index + 1),
      campaign_info: {
        name: record.campaign_info?.name || "Unknown Campaign",
        budget_type: record.campaign_info?.budget_type || "Not specified"
      },
      features: {
        numeric: {
          ctr: record.features?.numeric?.ctr || 0,
          cpa: record.features?.numeric?.cpa || 0,
          roas: record.features?.numeric?.roas || 0,
          cpm: record.features?.numeric?.cpm || 0,
          impressions: record.features?.numeric?.impressions || 0,
          clicks: record.features?.numeric?.clicks || 0,
          spend: record.features?.numeric?.spend || 0,
          conversions: record.features?.numeric?.conversions || 0,
          revenue: record.features?.numeric?.revenue || 0,
          reach: record.features?.numeric?.reach || 0,
          adds_to_cart: record.features?.numeric?.adds_to_cart || 0,
          cart_to_purchase_rate: record.features?.numeric?.cart_to_purchase_rate || 0,
          aov: record.features?.numeric?.aov || 0
        },
        categorical: {
          campaign_name: record.features?.categorical?.campaign_name || "Unknown",
          ad_set_budget_type: record.features?.categorical?.ad_set_budget_type || "Not specified",
          result_indicator: record.features?.categorical?.result_indicator || "Unknown"
        }
      },
      label: record.label || 'unknown',
      performance_score: record.score || 0,
      confidence: record.metadata?.confidence || 0.85,
      metadata: {
        annotated_at: record.metadata?.annotated_at || new Date().toISOString(),
        has_revenue_data: record.metadata?.has_revenue_data || false,
        row_number: record.metadata?.row_number || index + 1
      }
    };
  }),
  statistics: {
    label_distribution: labelCounts,
    feature_statistics: {
      ctr: calculateFeatureStats(annotatedRecords, 'ctr'),
      cpa: calculateFeatureStats(annotatedRecords, 'cpa'),
      roas: calculateFeatureStats(annotatedRecords, 'roas'),
      cpm: calculateFeatureStats(annotatedRecords, 'cpm'),
      revenue: calculateFeatureStats(annotatedRecords, 'revenue'),
      aov: calculateFeatureStats(annotatedRecords, 'aov')
    },
    total_samples: annotatedRecords.length,
    campaigns_analyzed: [...new Set(annotatedRecords.map(r => r.campaign_info?.name))].length
  }
};

return [{ json: mlDataset }];
